import React from "react";

const ImageList = ({ images }) => {
  console.log(images);
  const Images = images.map((m,index)=> {
    return <div><img key={index} src={m.urls.regular} alt="error404" className="col-6"/></div>;
  });

  return <div className="fontifyr">{Images}</div>;
};

export default ImageList;
